import { Swiper, SwiperSlide } from "swiper/react";
import { swipperimage } from "../../../imagesdep";
// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import "./Swipper.css";

// import required modules
 import { Pagination, Navigation } from "swiper";

 const ExploreImages=()=> {
   return (
     <>
       <Swiper
       breakpoints={
         {
           0:{
             slidesPerView:1,
             spaceBetween:10
           },
           480:{
             slidesPerView:1,
             spaceBetween:10
           },
           768:{
             slidesPerView:1,
             spaceBetween:15
           },
           1024:{
             slidesPerView:3,
             spaceBetween:15
           },
           1280:{
             slidesPerView:3,
             spaceBetween:25
           }
         }
       }
         slidesPerView={3}
         spaceBetween={30}
         slidesPerGroup={3}
         loop={true}
         loopFillGroupWithBlank={true}
         pagination={{
           clickable: true,
         }}
         navigation={true}
         modules={[Pagination, Navigation]}
         className="mySwiper"
       >
         <div className="swipper-container">
         <SwiperSlide className='swipper-item'>
           <img src={swipperimage} alt="" />
           <div className='swipper-information'>
             <h1>Bored Ape kannel club</h1>
             <div className='swipper-info'>
               <p>items in</p>
               <div className='inf'>
                 <h3>
                   <span>collection</span>
                   <span>category</span>
                 </h3>
                 <h3>
                   <span>324/324</span>
                   <span>crypto</span>
                 </h3>
               </div>
             </div>
           </div>
           <button>Explore Bored Ape</button>
         </SwiperSlide>
         </div>
       </Swiper>
     </>
   );
 }
 export default ExploreImages;
